textOriginal:
A arquidiocese não permite o uso político do evento, mas o Bolsonaro já está usando mesmo assim, a partir do momento que a imprensa divulga as imagens dele lá. Bolsonaro não foi lá como católico, até porque ele não é: hora ele se diz evangélico (batizado por um pastor que está preso), hora se diz católico, hora vai à maçonaria... veste a camisa do Palmeiras, depois a do Flamengo...atira para todo lado. É óbvio que ele só foi nesse evento para que as imagens fossem noticiadas. 

Bolsonaro é um cristão de farsa, que blasfema contra Deus ao se comparar à "messias" e ao inventar um Jesus armamentista. E é oposição à tudo que Jesus ensinou, só quer saber do rótulo para pescar eleitor alienado.

Bolsonaro representa:

- Sigilo de 100 anos;
- Orçamento Secreto (corrupção institucionalizada);
- Corrupção em barras de ouro no MEC;
- Corrupção no esquema da Cloroquina;
- Superfaturamento nas vacinas;
- Gastos com próteses penianas e viagra;
- Rachadinhas;
- Imóveis comprados com dinheiro vivo;
- "Passagem da boiada";
- Deboche aos doentes pela Covid;
- Vagabundices com jetski e motociata com frequência;
- Compra de votos e coação de eleitores;
- Xenofobia e racismo;
- Disposição ao CANIBALISMO;
- Histórico de ZOOFILIA (declaração dele ao CQC, mediante confirmação de polígrafo);
- Verborragias pornográficas;
- Jesus armamentista (blasfêmia para os verdadeiros cristãos);
- Obscurantismo travestido de "fé";
- Terraplanismo;
- Apologia ao Nazismo;
- Aparelhamento do estado;
- Apropriação de recursos do estado para fins pessoais (avião da FAB transportando convidados do casamento do Edu Bananinha, por exemplo);
- Cocaína no avião de comitiva presidencial (só foi barrado na Espanha, tamanha a incompetência ou conivência dos militares brasileiros);
- Ministros charlatões (com falsificação de currículo);
- FOME - FILA DO OSSO, queda no poder aquisitivo da população (inclusive de classe média);
- Precarização aos trabalhadores;
- Humilhação aos pobres;
- Aumento da violência urbana;
- Milícias à vontade;
- Baixaria, fanatismo, e alienação;
- Hipocrisias;
- Isolamento nas relações internacionais (brigas sem sentido, contra outras nações);
